import React, {Component} from 'react';
import './Footer.css'

class Footer extends Component {
    render() {
        return (
            <div id="footer">
                <div className="container">
                    <p>Copyright 2017. Bản quyền thuộc về HomeGroup</p>
                    <p>Số ĐKKD - 0106776554 Cấp ngày 12/02/2015</p>
                    <p>Được cấp bởi Sở KH&ĐT Thành Phố Hà Nội</p>
                </div>
            </div>
        );
    }
}

export default Footer;
